import React from "react";

import TableCell from "./tablecell.js";

function TableColumn({ columnID, column }) {
  return (
    <div className="table-column">
      {columnID == null
        ? "Loading..."
        : columnID.map((columnID) => (
            <TableCell columnID={columnID} />
          ))}
    </div>
  );
}

export default TableColumn;
